// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.24;

import 'hardhat/console.sol';
import './dependencies/IERC20.sol';
import './dependencies/IStaking.sol';

contract JobBoard {
  IERC20 public immutable mainToken;
  IStaking public immutable stakingContract;

  uint256 tokenAmountForPosting;
  uint256 tokenAmountForApplying;

  address public owner;

  struct Application {
    string application;
    uint salary;
    string location;
    uint timestamp;
  }

  struct Job {
    address employer;
    string title;
    string description;
    string qualifications;
    uint salaryFrom;
    uint salaryTo;
    string location;
    uint timestamp;
    mapping(address => bool) applied;
    Application[] applications;
  }

  struct JobList {
    uint id;
    string title;
    string description;
    string qualifications;
    string location;
    uint salaryFrom;
    uint salaryTo;
    uint applicationCount;
    bool applied;
    uint timestamp;
  }

  mapping(uint => Job) public jobs;
  uint public jobCount;

  event JobPosted(
    uint jobId,
    address indexed employer,
    string indexed title,
    string location,
    uint salaryFrom,
    uint salaryTo,
    string description,
    string qualifications,
    uint timestamp
  );
  event JobApplied(
    address indexed applicant,
    uint indexed jobId,
    string application,
    uint salary,
    string location,
    uint timestamp
  );

  modifier onlyOwner() {
    require(msg.sender == owner, 'not authorized');
    _;
  }

  modifier onlyStaker() {
    uint stakingAmount = stakingContract.balanceOf(msg.sender);
    require(stakingAmount > 0, 'You have to stake first.');
    _;
  }

  modifier onlyTokenHolder(uint limit) {
    uint tokenAmount = mainToken.balanceOf(msg.sender);
    require(tokenAmount > limit, 'Insufficient Token Balance.');
    _;
  }

  constructor(address _tokenAddress, address _stakingAddress) {
    owner = msg.sender;
    stakingContract = IStaking(_tokenAddress);
    mainToken = IERC20(_stakingAddress);
    tokenAmountForApplying = 1 * 1e18;
    tokenAmountForPosting = 2 * 1e18;
  }

  function trasnferOwner(address _address) public onlyOwner {
    owner = _address;
  }

  function postJob(
    string memory _title,
    string memory _description,
    string memory _qualifications,
    string memory _location,
    uint _salaryFrom,
    uint _salaryTo
  ) external onlyStaker onlyTokenHolder(tokenAmountForPosting) {
    Job storage newJob = jobs[jobCount];
    mainToken.transferFrom(msg.sender, owner, tokenAmountForPosting);
    newJob.employer = msg.sender;
    newJob.title = _title;
    newJob.description = _description;
    newJob.qualifications = _qualifications;
    newJob.location = _location;
    newJob.salaryFrom = _salaryFrom;
    newJob.salaryTo = _salaryTo;
    newJob.timestamp = block.timestamp;

    emit JobPosted(
      jobCount,
      msg.sender,
      _title,
      _location,
      _salaryFrom,
      _salaryTo,
      _description,
      _qualifications,
      block.timestamp
    );
    jobCount++;
  }

  function setTokenAmountForPosting(uint256 _tokenAmount) public onlyOwner {
    tokenAmountForPosting = _tokenAmount;
  }

  function setTokenAmountForApplying(uint256 _tokenAmount) public onlyOwner {
    tokenAmountForApplying = _tokenAmount;
  }

  function applyForJob(
    uint _jobId,
    string memory _application,
    uint _salary,
    string memory _location
  ) external onlyStaker onlyTokenHolder(tokenAmountForApplying) {
    mainToken.transferFrom(msg.sender, owner, tokenAmountForApplying);
    require(!jobs[_jobId].applied[msg.sender], 'Already applied');
    jobs[_jobId].applied[msg.sender] = true;
    jobs[_jobId].applications.push(
      Application(_application, _salary, _location, block.timestamp)
    );
    emit JobApplied(
      msg.sender,
      _jobId,
      _application,
      _salary,
      _location,
      block.timestamp
    );
  }

  function getAllJobs(
    address _address
  ) external view returns (JobList[] memory) {
    JobList[] memory jobList = new JobList[](jobCount);
    for (uint i = 0; i < jobCount; i++) {
      jobList[i].id = i;
      jobList[i].title = jobs[i].title;
      jobList[i].description = jobs[i].description;
      jobList[i].qualifications = jobs[i].qualifications;
      jobList[i].location = jobs[i].location;
      jobList[i].salaryFrom = jobs[i].salaryFrom;
      jobList[i].salaryTo = jobs[i].salaryTo;
      jobList[i].applied = jobs[i].applied[_address];
      jobList[i].applicationCount = jobs[i].applications.length;
    }
    return jobList;
  }

  function getApplications(
    uint _jobId
  ) external view returns (Application[] memory) {
    return jobs[_jobId].applications;
  }

  function getApplicationCount(
    address _address
  ) external view returns (uint256) {
    uint256 count = 0;
    for (uint i = 0; i < jobCount; i++) {
      if (jobs[i].applied[_address]) count++;
    }
    return count;
  }
}

